function App() {
  return (
    <div className="bg-gray-100 min-h-screen text-gray-900 font-sans">
      <header className="bg-indigo-600 text-white p-4">
        <h1 className="text-2xl font-bold">Marewane FERTIKH – Portfolio</h1>
      </header>

      <main className="p-6 space-y-8 max-w-4xl mx-auto">
        <section id="presentation">
          <h2 className="text-xl font-semibold mb-2">Présentation</h2>
          <p>
            Étudiant en 2ᵉ année de BUT Informatique à l'IUT de Villetaneuse (Université Sorbonne Paris Nord).
            Passionné par la programmation, les mathématiques et la data. Mon parcours est marqué par des projets d’équipe qui m’ont permis de développer mes compétences techniques et ma méthodologie.
          </p>
        </section>
      </main>
    </div>
  );
}

export default App;
